import React from 'react';
import "../styling/Search.css";
import LeftArrow from '../styling/left-arrow.png';

function Search() {
    return (
        <div className='main-body'>
            <img src={LeftArrow} alt="Arrow" />
        </div>
    );
}

export default Search;
